import "../../Styles/transaction.css";
import React from "react";

const ChooseTransactionTypeComponent = props => {
    return (
        <>
        <h4>choose transaction type</h4>
        <div id="choose-transaction" class="X">
            <div id="transaction" class="X-flex-1 ta-center">
                <h5>transaction</h5>
            </div>
            <div id="fee-bump" class="X-flex-1 ta-center ">
                <h5>fee bump</h5>
            </div>
        </div>
        </>
    )
}
export default ChooseTransactionTypeComponent;
